script: |
  super -f text -I q2310.spq | sort > q2310.out

inputs:
  - name: q2310.spq
    data: |
      SELECT DISTINCT col0 AS col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT + 55 NOT BETWEEN + col2 * - 97 AND ( ( + col0 ) );
  - name: tab1

outputs:
  - name: q2310.out
    data: |
      85
      91
